import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <body>
        <header className="header">
            <div id="icon">Futuro4 Videos</div>
            <input type="text" id="busca"></input>
        </header>
        <main className="containermain">
            <div id="img1">
              <img src={require("/imagens/video1.png"), alt="celtic"}></img>
              <p>Video 1</p>
            </div>
        </main>
        <footer>
            <p>Fim da pagina</p>
        </footer>
      </body>      
    </div>
  );
}

export default App;
